package model.entity;import javax.persistence.*;@Entity@Table(name = "user_role", schema = "", catalog = "registru")public class UserRoleEntity {    private long idRole;    private String role;    private String username;    @Id    @Column(name = "id_role", nullable = false, insertable = true, updatable = true)    public long getIdRole() {        return idRole;    }    public void setIdRole(long idRole) {        this.idRole = idRole;    }    @Basic    @Column(name = "role", nullable = false, insertable = true, updatable = true, length = 150)    public String getRole() {        return role;    }    public void setRole(String role) {        this.role = role;    }    @Basic    @Column(name = "username", nullable = false, insertable = true, updatable = true, length = 150)    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        UserRoleEntity that = (UserRoleEntity) o;        if (idRole != that.idRole) return false;        if (role != null ? !role.equals(that.role) : that.role != null) return false;        if (username != null ? !username.equals(that.username) : that.username != null) return false;        return true;    }    @Override    public int hashCode() {        int result = (int) (idRole ^ (idRole >>> 32));        result = 31 * result + (role != null ? role.hashCode() : 0);        result = 31 * result + (username != null ? username.hashCode() : 0);        return result;    }}